  namespace: Google.Api.Gax.Grpc
  summary: "\nThis method merges the settings in <span class=\"paramref\">overlaid</span> with those in\n<span class=\"paramref\">original</span>, with <span class=\"paramref\">overlaid</span> taking priority.\nIf both arguments are null, the result is null. If one argument is null,\nthe other argument is returned. Otherwise, a new object is created with a property-wise\noverlay, where null values do not override non-null values.\nAny header mutations are combined, however: the mutation from the original is\nperformed, then the mutation in the overlay.\n"
  example: []
  syntax:
    content: public static CallSettings MergedWith(this CallSettings original, CallSettings overlaid)
    parameters:
    - id: original
      type: Google.Api.Gax.Grpc.CallSettings
      description: Original settings. May be null.
    - id: overlaid
      type: Google.Api.Gax.Grpc.CallSettings
      description: Settings to overlay. May be null.
    return:
      type: Google.Api.Gax.Grpc.CallSettings
      description: A merged set of call settings, or null if both parameters are null.
    content.vb: >-
      <ExtensionAttribute>

      Public Shared Function MergedWith(original As CallSettings, overlaid As CallSettings) As CallSettings
